// src/components/Projects.jsx
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Projects = () => {
  return (
    <>
      <div>
        <ul class="Projects-list">
            <li>
                <img src="/assets/images/prjprvw.jpg" alt="Preview" className="w-64 h-40" />
                <p>Website</p>
                <h1>AIGO: Eat Smart, Move Better</h1>
                <p>As AI Developer</p>
                <h6>AIGO is a website that can be used by users to monitor their health conditions. Users can find out their body weight category index (BMI). Users who are already indicated as obese can also consult online or offline with doctors who have collaborated with AIGO. Users also get suggestions for exercises or activities that they should do to maintain their weight and health.</h6>
                <a href="#coba">Try it!</a>
            </li>
            <li>
                <img src="/assets/images/prjprvw.jpg" alt="Preview" className="w-64 h-40" />
                <p>Website</p>
                <h1>AIGO: Eat Smart, Move Better</h1>
                <p>As AI Developer</p>
                <h6>AIGO is a website that can be used by users to monitor their health conditions. Users can find out their body weight category index (BMI). Users who are already indicated as obese can also consult online or offline with doctors who have collaborated with AIGO. Users also get suggestions for exercises or activities that they should do to maintain their weight and health.</h6>
                <a href="#coba">Try it!</a>
            </li>
        </ul>
      </div>
    </>
  );
};

export default Projects;
